import { FullScreenContainer } from "../common/loginsignupstyles"
import {AppDiv,CenterAppbar,StyledImage,StyledLink} from "../common/Dashboardmain.styles"
import {CardInnerDiv,CardOuterDiv} from "./Dashboard.styles"
import tataimage from "../../assets/pngs/Final logo - Tata motors .png"
import photo from "../../assets/logos/Logo_with_text.svg"
import berrysimage from "../../assets/pngs/Berrys.png";
import proto from "../../assets/pngs/Proto.png";
import CardComponent from './DashboardComponents/CardComponent';
import { useState,useEffect } from "react"
import { Grid,Alert,CircularProgress } from "@mui/material"
import axios from "axios"

const cardsData=[{
    id:1,
    imageBuyer:tataimage,
    buyer: "TATA Motors",
    seller :"Berrys Auto",
    imageSeller:berrysimage,
    unitcost:"10,000", 
    Repayment:"52,883",
    xirr:"15.29%",
    totalunit:"1000",

    remainingunit:"234",
    tenure:"60"

},{ 
    id:2,
    imageBuyer:tataimage,
    buyer: "TATA Motors",
    seller :"Proto D Industries",  
    imageSeller:proto,
    unitcost:"10,000",
    Repayment:"52,883",
    xirr:"15.09%",
    totalunit:"500",
    remainingunit:"134", 
    tenure:"60"

},
{   
    id:3,
    imageBuyer:tataimage,
    buyer: "TATA Motors",
    seller :"Berrys Auto",
    imageSeller:berrysimage,
    unitcost:"10,000",
    Repayment:"52,883",
    xirr:"15.29%",
    totalunit:"1000",
    remainingunit:"234",
    tenure:"60"
},
{   
    id:4,
    imageBuyer:tataimage,
    buyer: "TATA Motors",
    seller :"Berrys Auto",
    imageSeller:berrysimage,
    unitcost:"10,000",
    Repayment:"52,883",
    xirr:"15.29%",
    totalunit:"1000",
    remainingunit:"234",
    tenure:"60"
},{ 
    id:5,
    imageBuyer:tataimage,
    buyer: "TATA Motors",
    seller :"Berrys Auto",
    imageSeller:berrysimage,
    unitcost:"10,000",
    Repayment:"52,883",
    xirr:"15.29%",
    totalunit:"1000",
    remainingunit:"234",
    tenure:"60"
},{
    id:6,
    imageBuyer:tataimage,
    buyer: "TATA Motors",
    seller :"Berrys Auto",
    imageSeller:berrysimage,
    unitcost:"10,000",
    Repayment:"52,883",
    xirr:"15.29%",
    totalunit:"1000",
    remainingunit:"234",
    tenure:"60"
}]
const Dashboard = () => {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    fetchProducts();
  }, []);

  const fetchProducts = async () => {
    try {
      const response = await axios.get("http://localhost:8000/api/v1/users/products"); // Adjust URL as needed
      setProducts(response.data.data); // Assuming your API response structure
    } catch (error) {
      console.error("Error fetching products:", error);
    }
  };

  return (
    <FullScreenContainer>
      <AppDiv>
        <StyledImage src={photo}></StyledImage>
        <CenterAppbar></CenterAppbar>
        <div>
          <StyledLink to="/signup"> Logout</StyledLink>
        </div>
      </AppDiv>

      <CardOuterDiv>
        {products.map((product) => (
          <CardComponent
            key={product._id}
            id={product._id}
            buyer={product.BuyerName}
            seller={product.SellerName}
            unitcost={product.UnitPrice}
            repayment={product.TotalUnits}
            xirr={product.Xirr}
            totalunit={product.TotalUnits}
            remainingunit={product.RemainingUnits}
            tenure={product.Tenure}
          />
        ))}
      </CardOuterDiv>
    </FullScreenContainer>
  );
};

export default Dashboard;
